ato y las erupciones cutáneas o cambios de color en los dedos de las manos o los pies. Estos síntomas suelen ser leves y comienzan gradualmente. Algunas de las personas infectadas solo presentan síntomas levísimos.\r\n\r\n            <br><br>La mayoría de las personas (alrededor del 80%) se recuperan de la enfermedad sin necesidad de tratamiento hospitalario. Alrededor de 1 de cada 5 personas que contraen la COVID‑19 acaba presentando un cuadro grave y experimenta dificultades para respirar. Las personas mayores y las que padecen afecciones médicas previas como hipertensión arterial, problemas cardiacos o pulmonares, diabetes o cáncer tienen más probabilidades de presentar cuadros graves. Sin embargo, cualquier persona puede contraer la COVID‑19 y caer gravemente enferma.\r\n            Las personas de cualquier edad que tengan fiebre o tos y además respiren con dificultad, sientan dolor u opresión en el pecho o tengan dificultades para hablar o moverse deben solicitar atención médica inmediatamente. Si es posible, se recomienda llamar primero al profesional sanitario o centro médico para que estos remitan al paciente al establecimiento sanitario adecuado.\r\n        </p>\r\n        <br>\r\n        <br>\r\n        <p>\r\n            <img src=\"https://www.gstatic.com/healthricherkp/covidsymptoms/light_fever.gif\" align=\"left\" style=\"width:128px;height:128px;\" alt=\"Fiebre\"> <div align=\"center\"><img src=\"https://www.gstatic.com/healthricherkp/covidsymptoms/light_cough.gif\" style=\"width:128px;height:128px;\" alt=\"Tos seca\">  <img src=\"https://www.gstatic.com/healthricherkp/covidsymptoms/light_tiredness.gif\" alt=\"Cansancio\" align=\"right\" style=\"width:128px;height:128px;\"></div>\r\n        </p>\r\n\r\n        <br>\r\n        <br>\r\n\r\n        <h2>¿Cómo nos afecta?</h2>\r\n        <iframe width=\"1130\" height=\"600\" src=\"https://www.youtube.com/embed/2f3bWviThuQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; pict